import React from "react";
import { Box, Center, Flex, Checkbox, Stack, Heading } from "@chakra-ui/react";

const Quiz = () => {
    return (
        <Box w={"100%"} p={"20px"}>
            <Center h={"100%"}>
                <Flex w={"70%"} direction={"column"}>
                    <Heading  as="h4" size="md" is>This is message 1</Heading>

                    <Stack spacing={2} direction={"column"}>
                        <Checkbox colorScheme="red" defaultIsChecked>
                            Checkbox
                        </Checkbox>
                        <Checkbox colorScheme="green" defaultIsChecked>
                            Checkbox
                        </Checkbox>
                    </Stack>
                </Flex>
            </Center>
        </Box>
    );
};

export default Quiz;
